VALUES ('3596710390458', 'Mini Cône Chocolat', 'Mini-cône vanille Crème glacée à la vanille 56,5% : lait écrémé réhydraté 68,4%*, sucre, beurre (contient lait), sirop de glucose-fructose, sirop de glucose, émulsifiant: mono-et diglycérides d\'acides gras; stabilisants: farine de graines de caroube, gomme de guar, arôme naturel de vanille 0,2%&quot;. *Pourcentages exprimés sur la crème glacée à la vanille. Gaufrette 22.9% : farine de blé (contient gluten), sucre, émulsifiant: lécithine de soja, huile de coco, se. Chemisage et décor au cacao maigre 17,7% : matière grasse végétale de coco, sucre, cacao maigre en poudre 15,5%&quot;, émulsifiant : lécithine de soja. Noisettes (fruits a coque) hachées torréfiées 2,9% Mini-cône chocolat Crème glacée au chocolat 56,5%: lait écrémé réhydraté 59,8%*, sucre, beurre (contient lait) sirop de glucose-fructose, cacao maigre en poudre 4,5%, chocolat au lait 4%&quot; (sucre, lait entier en poudre 24%**, beurre de cacao, pâte de cacao 8%&quot;, arôme naturel de vanille, émulsifiant : lécithine de soja), lactose (contient lait) et protéines de lait, chocolat 2%&quot; (sucre, pâte de cacao 47,5% , cacao maigre en poudre, arôme naturel de vanille), sirop de glucose, émulsifiant: mono-et diglycérides d\'acides gras; stabilisants: farine de graines de caroube, gomme de guar. \'Pourcentages exprimés sur la crème glacée au chocolat. &quot;&quot;Pourcentage exprimé sur le chocolat au lait. &quot;Pourcentage exprimé sur le chocolat Gaufrette 22,9% : farine de blé (contient gluten), sucre, émulsifiant : lécithine de soja, huile de coco, sel. Chemisage et décor au cacao maigre 17,7% : matière grasse végétale de coco, sucre, cacao maigre en poudre 15,5% , émulsifiant: lécithine de soja.  Copeaux de chocolat 2,9%: sucre, pâte de cacao, beurre de cacao, arôme naturel de vanille, émulsifiant: lécithine de soja.', 'https://static.openfoodfacts.org/images/products/359/671/039/0458/front_fr.7.400.jpg', '18', '13', '37', '23', '1.7', '4', '0', '0', '',